a_Fade_Rate>4.0</Encyclopedia_Fade_Rate>\n   <Encyclopedia_Min_Display_Time>1.0</Encyclopedia_Min_Display_Time>\n\n   <Min_Accuracy_For_Icon> 0.4 </Min_Accuracy_For_Icon>\n   <Min_Sight_Range_For_Icon> 0.5 </Min_Sight_Range_For_Icon>\n\n   <Left_Queue_Tint>128 128 255 215</Left_Queue_Tint>\n   <Right_Queue_Tint>255 128 128 215</Right_Queue_Tint>\n\n\t<Icons_Per_Column>13</Icons_Per_Column>\n\n\t<Hint_Text_Color>0 193 91</Hint_Text_Color>\n\t<System_Text_Color>255 24 39</System_Text_Color>\n\t<Task_Text_Color>109 247 255</Task_Text_Color>\n\t<Speech_Text_Color>255 255 255</Speech_Text_Color>\n\n\t<CB_Movie_Offset>0 200</CB_Movie_Offset>\n\t<CB_Movie_Color>255 255 255 220</CB_Movie_Color>\n\n\t<!-- Top left positions of vertical countdown timers list - like production, retreat, death star range, -->\n\t<!-- Note: There could be mutliple timers simultaneously in a vertical list -->\n\n\t<GUI_Tactical_Countdown_Timers_Screen_X> 0.005 </GUI_Tactical_Countdown_Timers_Screen_X>\n\t<GUI_Tactical_Countdown_Timers_Screen_Y> 0.10 </GUI_Tactical_Countdown_Timers_Screen_Y>\n\t<GUI_Tactical_Countdown_Timers_Screen_Spacing> 0.05 </GUI_Tactical_Countdown_Timers_Screen_Spacing>\n\n\t<GUI_Strategic_Countdown_Timers_Screen_X> 0.005 </GUI_Strategic_Countdown_Timers_Screen_X>\n\t<GUI_Strategic_Countdown_Timers_Screen_Y> 0.02 </GUI_Strategic_Countdown_Timers_Screen_Y>\n\t<GUI_Strategic_Countdown_Timers_Screen_Spacing> 0.05 </GUI_Strategic_Countdown_Timers_Screen_Spacing>\n\n    <BeaconPlaceDelay>5000</BeaconPlaceDelay>\n\n\t<WaypointLineLandDashLength> 5.0 </WaypointLineLandDashLength>\n\t<WaypointLineLandGapLength> 5.0 </WaypointLineLandGapLength>\n\t<WaypointLineLandDashVelocity> 1.0 </WaypointLineLandDashVelocity>\n\t\n\t<MaxWaypointsPerPath> 6 </MaxWaypointsPerPath>\n\n\t<!-- Asteroid Field -->\n\t<Asteroid_Field_Damage>20</Asteroid_Field_Damage>\n\t<Asteroid_Field_Damage_Rate>0.20</Asteroid_Field_Damage_Rate> <!--Probability the damage is applied in each frame, [0..1]-->\n\t\n\n\t<!-- Pathfinding and Movement -->\n\t<SpacePathfindMaxExpansions> 3500 </SpacePathfindMaxExpansions>\n\t<CurrentPathCostCoefficientSpace> .66 </CurrentPathCostCoefficientSpace>\t\n\n\t<SpacePathfindFrameDelayDelta> 2 </SpacePathfindFrameDelayDelta>\n\t\n\t<SpacePathFailureDistanceCutoffCoefficient> .25 </SpacePathFailureDistanceCutoffCoefficient>\n\t<SpacePathFailureMaxExpansionsCoefficient> 1.7 </SpacePathFailureMaxExpansionsCoefficient>\n\t<SpacePathFailureRotationExpansionIncrement> .5 </SpacePathFailureRotationExpansionIncrement>\n\t<SpacePathFailureForwardExpansionIncrement> .5 </SpacePathFailureForwardExpansionIncrement>\n\t<SpacePathingTries> 6 </SpacePathingTries>\n\n\t<SpaceStaticObstacleAvoidanceBonusDistance> 0 </SpaceStaticObstacleAvoidanceBonusDistance>\t\t\n\t\t\n\t<MinObstacleCostSpace> 15.0 </MinObstacleCostSpace>\n\t<MaxObstacleCostSpace> 15.0 </MaxObstacleCostSpace>\n\t<ObstacleAreaOverlapForMaxSpace> 1.0 </ObstacleAreaOverlapForMaxSpace>\n\t<XYExpansionDistanceSpace> 300.0 </XYExpansionDistanceSpace>\n\t<MaxRotationsSpace> 24.0 </MaxRotationsSpace>\n\t<MatchFacingDeltaSpace> 10.0 </MatchFacingDeltaSpace>\n\t<OccupationRadiusCoefficientSpace> 1.2 </OccupationRadiusCoefficientSpace>\n\t<DestinationSearchRadiusIncrementSpace> 50.0 </DestinationSearchRadiusIncrementSpace>\n\t<UseLinearCollisionChecks> true </UseLinearCollisionChecks>\n\t<WaitOperatorCostCoefficient> .8 </WaitOperatorCostCoefficient>\n\t<WaitOperatorBaseFrameTime> 100 </WaitOperatorBaseFrameTime>\n\t<WaitOperatorSpeedCoefficient> .2 </WaitOperatorSpeedCoefficient>\n\t<LandWaitOperatorSpeedCoefficient> .65 </LandWaitOperatorSpeedCoefficient>\n\t<SpaceLocomotorFacingLookaheadAcc> 1.0 </SpaceLocomotorFacingLookaheadAcc>\n\t<FinalFacing180Penalty> 1.5 </FinalFacing180Penalty>\n\t<SpecialAlignedOperatorBonus> .6 </SpecialAlignedOperatorBonus>\n\t<ThreatExpansionDistance> 600.0 </ThreatExpansionDistance>\n\t<OffMapCostPenalty> 20.0 </OffMapCostPenalty>\n\t<MaxLandFormationFormupFrames> 240.0 </MaxLandFormationFormupFrames>\n\t<SpaceObjectTrackingInterval> 90 </SpaceObjectTrackingInterval>\n\t<SpaceObjectTrackingTreeCount> 45 </SpaceObjectTrackingTreeCount>\n\t<ShouldDisplayPredictionPaths> false </ShouldDisplayPredictionPaths>\n\t<ShouldDisplaySyncedPaths> false </ShouldDisplaySyncedPaths>\n\t<SyncedFrameInterval> 75.0 </SyncedFrameInterval>\n\t<LandPredictionTimeInterval> 2.0 </LandPredictionTimeInterval>\t\n\t<RepushDistance> 6.0 </RepushDistance>\n\t<MinLandPredictionDistance> 60.0 </MinLandPredictionDistance>\n\t<ShouldSkipLandFormup> true </ShouldSkipLandFormup>\n\t<ShouldInfantryTeamsSplitAcrossFormations> true </ShouldInfantryTeamsSplitAcrossFormations>\n\t<VehicleFormationRecruitmentDistance> 100 </VehicleFormationRecruitmentDistance>\n\t<InfantryFormationRecruitmentDistance> 60 </InfantryFormationRecruitmentDistance>\n\t<CloseEnoughAngleForMoveStart> 180 </CloseEnoughAngleForMoveStart>\t\n\t<DynamicObstacleOverlapPenalty> 15.0 </DynamicObstacleOverlapPenalty>\n\t<DynamicAvoidanceRectangleBound> 3 </DynamicAvoidanceRectangleBound>\n\t<ShouldDisplayPotentialPath> false </ShouldDisplayPotentialPath>\n\t\n\t<TurnInPlaceSlowdownCorvette> 2.0 </TurnInPlaceSlowdownCorvette>\n\t<TurnInPlaceSlowdownFrigate> 3.0 </TurnInPlaceSlowdownFrigate>\n\t<TurnInPlaceSlowdownCapital> 4.0 </TurnInPlaceSlowdownCapital>\n\t\n\t<FormationMinimumSideError> .1 </FormationMinimumSideError>\n\t<FormationMaximumSideError> 30.0 </FormationMaximumSideError>\n\t<ApproximationSmoothCosAngle> .9962 </ApproximationSmoothCosAngle>\n\t<ApproximationForwardDistance> 2.0 </ApproximationForwardDistance>\n\t<MinimumStoppedVsStoppedOverlapCoefficient> .15 </MinimumStoppedVsStoppedOverlapCoefficient>\n\t<MovingVsMovingLookAheadTime> 1.5 </MovingVsMovingLookAheadTime>\n\t<LandTemporaryDestinationProximity> 20.0 </LandTemporaryDestinationProximity>\n\t<LandDestinationProximity> 60.0 </LandDestinationProximity>\n\t<BetweenFormationSpacing> 5.0 </BetweenFormationSpacing>\t\n\t\n\t<Destination_Collision_Query_Extension> 60 </Destination_Collision_Query_Extension>\n\t\n\t<FramesPerPositionApproximationRebuild>8</FramesPerPositionApproximationRebuild>\n\t<FramesPerCollisionCheck> 4 </FramesPerCollisionCheck>  <!-- each object only checks for pathfind collisions every 'n' frames -->\t\n\t<MovementReevaluationFrameCount> 10 </MovementReevaluationFrameCount>\n\t\n\t<DynamicLandComplexityQuota> 100 </DynamicLandComplexityQuota>\n\t<DynamicLandQuotaResetInterval> 5 </DynamicLandQuotaResetInterval>\n\t\n\t<FinalFormationFacingMinimumAngle> 10.0 </FinalFormationFacingMinimumAngle>\n\t<FinalFormationFacingDeltaCoefficient> .5 </FinalFormationFacingDeltaCoefficient>\n\t\n\t<WalkAnimationCutoff> .6 </WalkAnimationCutoff>\n\t\n\t<DoubleClickMoveMaxSpeedRatio> 1.25 </DoubleClickMoveMaxSpeedRatio>\n\t\n\t<Fleeing_Infantry_Speed_Bonus> 2 </Fleeing_Infantry_Speed_Bonus>\n\t\n\t<IdleWalkBlendTime> .5 </IdleWalkBlendTime>\n\t<CrouchIdleWalkBlendTime> .5 </CrouchIdleWalkBlendTime>\n\t<MoveBlendTime> .5 </MoveBlendTime>\n\t<CrouchMoveBlendTime> .75 </CrouchMoveBlendTime> \n\t<TeamMoveBlendTime> .2 </TeamMoveBlendTime>\n\t<TeamCrouchMoveBlendTime> .5 </TeamCrouchMoveBlendTime> \n\t<InfantryTurnBlendTime> .2 </InfantryTurnBlendTime>\n\n\t<Map_Preview_Image_Size> 1024 </Map_Preview_Image_Size>\n\t<Countdowns_Font_Name>EmpireAtWar-Medium</Countdowns_Font_Name>\n\t<Countdowns_Font_Size>12</Countdowns_Font_Size>\n\t<In_Game_Message_Default_Font_Name>EmpireAtWar-Medium</In_Game_Message_Default_Font_Name>\n\t<In_Game_Message_Default_Font_Size>8</In_Game_Message_Default_Font_Size>\n\t<Event_Message_Default_Font_Name>EmpireAtWar-Medium</Event_Message_Default_Font_Name>\n\t<Event_Message_Default_Font_Size>7</Event_Message_Default_Font_Size>\n\t<Bink_Player_Caption_Font_Name>EmpireAtWar-Medium</Bink_Player_Caption_Font_Name>\n\t<Bink_Player_Caption_Font_Size>10</Bink_Player_Caption_Font_Size>\n\t<Tool_Tip_Font_Name>Arial</Tool_Tip_Font_Name>\n\t<Tool_Tip_Font_Size>7</Tool_Tip_Font_Size>\n\t<Tool_Tip_Small_Font_Name>Arial</Tool_Tip_Small_Font_Name>\n\t<Tool_Tip_Small_Font_Size>5</Tool_Tip_Small_Font_Size>\n\t<Command_Bar_Default_Font_Name>EmpireAtWar-Medium</Command_Bar_Default_Font_Name>\n\t<Command_Bar_Default_Font_Size>7</Command_Bar_Default_Font_Size>\n\t<Text_Button_Default_Font_Name>EmpireAtWar-Medium</Text_Button_Default_Font_Name>\n\t<Text_Button_Default_Font_Size>7</Text_Button_Default_Font_Size>\n\t<Game_Object_Name_Font_Name>EmpireAtWar-Medium</Game_Object_Name_Font_Name>\n\t<Game_Object_Name_Font_Size>7</Game_Object_Name_Font_Size>\n\n\t<!--Win/Lose messages at the end of tactical -->\n\t<Win_Message_Color>223, 243, 255, 255</Win_Message_Color> \t<!-- Note: 255, 200, 120, 255 TAN is way too hard to read on Tattooine -->\n\t<Lose_Message_Color>255, 244, 223, 255</Lose_Message_Color>\t<!-- Note: 255, 200, 120, 255 TAN is way too hard to read on Tattooine -->\n\t<Win_Lose_Message_Font>EmpireAtWar-Bold</Win_Lose_Message_Font>\n\n\t<!-- MBL: Had to reduce for enlarged message and localization - it will probably have to go multi-line or be even smaller still  -->\n\t<!-- <Win_Lose_Message_Font_Size>36</Win_Lose_Message_Font_Size> -->\n\t<Win_Lose_Message_Font_Size> 24 </Win_Lose_Message_Font_Size>\n\n\t<!-- Strategic Galactic Mode: Tactical battle pending message -->\n\t<Battle_Pending_Message_Font> EmpireAtWar-Bold </Battle_Pending_Message_Font>\n\t<Battle_Pending_Message_Font_Size> 14 </Battle_Pending_Message_Font_Size>\n\t<Battle_Pending_Message_Color> 255, 32, 32, 240 </Battle_Pending_Message_Color>\n\t<Battle_Pending_Message_Pos_X> -1.0 </Battle_Pending_Message_Pos_X> <!-- -1 means center, 0.0+ means use position -->\n\t<Battle_Pending_Message_Pos_Y> 0.0001 </Battle_Pending_Message_Pos_Y> \n\t\n\t<!-- Control Point Domination Victory Condition (Multiplayer Tactical): How long do you need to hold all control points before you win? -->\n\t<Control_Point_Domination_Victory_Time_In_Secs> 30.0 </Control_Point_Domination_Victory_Time_In_Secs>\n\t\n\t<!--Controls the height of each of the letter box bands done on cinematics as a percentage of the screen-->\n\t<Camera_FX_Manager_Letterbox_Height>.085f</Camera_FX_Manager_Letterbox_Height>\n\t\n\t<!--Land mode space-style pathfinding -->\n\t<LandObjectTrackingInterval> 20 </LandObjectTrackingInterval>\n\t<LandObjectTrackingTreeCount> 25 </LandObjectTrackingTreeCount>\n\t<MinObstacleCostLand> 3.0 </MinObstacleCostLand>\n\t<MaxObstacleCostLand> 3.0 </MaxObstacleCostLand>\n\t<XYExpansionDistanceLand> 60.0 </XYExpansionDistanceLand>\n\t\n\t<!-- Shield flashing effect -->\n\t<Shield_Flash_Scale> 1.0, 1.1, 1.25 </Shield_Flash_Scale>\n\t<Shield_Flash_Duration> 0.1 </Shield_Flash_Duration>\n\t\n\t<!-- How closely to tie hull vs. hard point healths together in releation to one another -->\n\t<Hull_Vs_Hard_Points_Health_Constraint> 0.2 </Hull_Vs_Hard_Points_Health_Constraint>\n\t\n\t<!-- An object being influenced by a telekinesis effect -->\n\t<Telekinesis_Hover_Height>22.0</Telekinesis_Hover_Height>\n\t<Telekinesis_Transition_Time>0.75</Telekinesis_Transition_Time>\n\t<Telekinesis_Wobble_Cycle_Time>1.5</Telekinesis_Wobble_Cycle_Time>\n\t<Telekinesis_Wobble_Fade_Time>1.0</Telekinesis_Wobble_Fade_Time>\n\t<Telekinesis_Max_Wobble_Angle>5.0</Telekinesis_Max_Wobble_Angle>\n\t<Telekinesis_Max_Bob_Height>3.0</Telekinesis_Max_Bob_Height>\n\t\n\t<Earthquake_Transition_Time> 2.0 </Earthquake_Transition_Time>\n\t<Earthquake_Shake_Speed> 1.0 </Earthquake_Shake_Speed>\n\t<Earthquake_Shake_Magnitude> 0.0, 0.0, 0.7 </Earthquake_Shake_Magnitude>\n\n\t<!-- AI threat tolerances for the discrete land mode reachability levels -->\n\t<Low_Threat_Reachability_Tolerance>1000.0</Low_Threat_Reachability_Tolerance>\n\t<Medium_Threat_Reachability_Tolerance>3000.0</Medium_Threat_Reachability_Tolerance>\n\t<High_Threat_Reachability_Tolerance>5000.0</High_Threat_Reachability_Tolerance>\n\n\t<Auto_Rotate_For_Space_Targeting>False</Auto_Rotate_For_Space_Targeting>\n\n\t<In_Game_Cinematics>True</In_Game_Cinematics>\t\n\t<Display_Bink_Movie_Frames>False</Display_Bink_Movie_Frames>  \n\n\t<!-- Global speed modifier to everything with engines, and when they are destroyed -->\n\t<Engines_Disabled_Speed_Modifier> 0.4 </Engines_Disabled_Speed_Modifier>\t\n\n\t<Crouch_Move_Fire_Angle_Cutoff> 20 </Crouch_Move_Fire_Angle_Cutoff>\n\t\n\t<Max_Move_Frame_Delay> 6 </Max_Move_Frame_Delay>\n\t\n\t<Spread_Out_Spacing_Coefficient> 1.8 </Spread_Out_Spacing_Coefficient>\n\n\t<Max_Formation_Area> 14.0 </Max_Formation_Area>\t\n\t\n\t<Short_Range_Attack_Formation_Coefficient> 1.6 </Short_Range_Attack_Formation_Coefficient>\n\n\t<Solo_Attack_Range> 60.0 </Solo_Attack_Range>\n\n\t<Base_Land_Targeting_Arc_Angle_Coefficient> .2 </Base_Land_Targeting_Arc_Angle_Coefficient>\t\n\t\n\t<Rotate_Formation_Facing_Moves> true </Rotate_Formation_Facing_Moves>\n\t\n\t<ShouldUseSpaceIdleMovement> false </ShouldUseSpaceIdleMovement>\n\t<SpaceIdleMovementSpeed> 0.0 </SpaceIdleMovementSpeed>\n\t<SpaceIdlePathCullCoefficient> 3.0 </SpaceIdlePathCullCoefficient>\n\t<IdleMovementFrames> 30.0 </IdleMovementFrames>\n\n\t<!-- Colors to use for the reinforcements terrain overlay (a,r,g,b) -->\n\t<ReinforcementOverlayGoodColor>0,128,0,128</ReinforcementOverlayGoodColor>\n\t<ReinforcementOverlayBadColor>128,0,0,128</ReinforcementOverlayBadColor>\n\n\t<!-- Per unit probability of destruction during a retreat -->\n\t<Space_Retreat_Attrition_Factor>0.0</Space_Retreat_Attrition_Factor>\n \t<Land_Retreat_Attrition_Factor>0.0</Land_Retreat_Attrition_Factor>\n \t<Blockade_Run_Attrition_Factor>0.2</Blockade_Run_Attrition_Factor>\n\n\t<!-- Base level vs. object tech level build speed factor: \n\t\t  A higher level base should be able to build lower level items faster than a lower level base could. \n\t\t  For example, it should be quicker to build basic troopers on a level 5 base than on a level 1 base. \n\t\t  Follow these build-time value coefficients initially: Take base level and subtract tech level of item being built. \n\t\t  The difference, if positive, has the following effect: Difference 0 = 100%, difference 1 = 90%, difference 2 = 75%, \n\t\t  difference 3 = 55%, difference 4 = 45%. Thus a level 1 base, builds all objects at 100% listed speed. \n\t\t  A level 5 base builds tech level 1 items in 45% of the time it would take a level 1 base. -->\n\n\t<Production_Speed_Mod_Base_Vs_Tech_0> 1.00 </Production_Speed_Mod_Base_Vs_Tech_0> <!-- 100% if difference (base level 1-5 minus tech level 0-5 - 1) is 0 or less -->\n\t<Production_Speed_Mod_Base_Vs_Tech_1> 0.90 </Production_Speed_Mod_Base_Vs_Tech_1> <!--  90% if difference is 1 -->\n\t<Production_Speed_Mod_Base_Vs_Tech_2> 0.75 </Production_Speed_Mod_Base_Vs_Tech_2> <!--  75% if difference is 2 -->\n\t<Production_Speed_Mod_Base_Vs_Tech_3> 0.55 </Production_Speed_Mod_Base_Vs_Tech_3> <!--  55% if difference is 3 -->\n\t<Production_Speed_Mod_Base_Vs_Tech_4> 0.45 </Production_Speed_Mod_Base_Vs_Tech_4> <!--  45% if difference is 4 or greater-->\n\n\n\t<!-- General set of filters for ranking (highest to lowest) for multiply selected units and command responses - like select, move, attack, guard, etc. -->\n\n\t<Unit_Command_Rankings_By_Category> Hero, Super, Capital, Frigate, Corvette, Transport, Bomber, Fighter, Air, Vehicle, Infantry, Structure </Unit_Command_Rankings_By_Category>\n\n\t<!-- Culling system constants -->\n\t<Space_Collidable_Grid_Cull_Size>500.0</Space_Collidable_Grid_Cull_Size>\n\t<Space_Large_Ship_Grid_Cull_Size>500.0</Space_Large_Ship_Grid_Cull_Size>\n\t<Land_Collidable_Grid_Cull_Size>64.0f</Land_Collidable_Grid_Cull_Size>\n\t\n\t<!-- Settings to define a \"Raid Force\" (ie. a land combat force that can bypass space combat) -->\n\t<Raid_Force_Required_Faction> Rebel </Raid_Force_Required_Faction>\n\t<Raid_Force_Limited_Object_Category_Mask> Infantry | Vehicle | Air </Raid_Force_Limited_Object_Category_Mask>\n\t<Raid_Force_Max_Limited_Objects> 2 </Raid_Force_Max_Limited_Objects>\n    <Raid_Force_Max_Heros> 1 </Raid_Force_Max_Heros>\n\t<Raid_Force_Free_Object_Category_Mask> LandHero </Raid_Force_Free_Object_Category_Mask>\t<!-- can have as many of these as you want -->\n\n\t<!-- Subjective thresholds for unit health levels - used by game object type SFXEvent triggers -->\n\t<Health_Low_Percent_Threshold> 0.33 </Health_Low_Percent_Threshold>\n\t<Health_Critical_Percent_Threshold> 0.10 </Health_Critical_Percent_Threshold>\n\n\t<Under_Construction_Damage_Multiplier> 2.0 </Under_Construction_Damage_Multiplier>\n\n\n\t<!--                                -->\n\t<!--    ARMOR AND DAMAGE SECTION    -->\n\t<!--                                -->\n\n\t<!-- DAMAGE TYPES to be applied against armor types for damage modifiers-->\n\t\n\t\n\t<!-- IMPORTANT NOTE: these will NOT WORK for special abilities and <Damage_Clone>, <Squash_Damage_Type> and \n\t\t <Internal_Damage_Type> tags. \n\t\t If you want to create armor vs. damage logic for damge used in those tags, PLEASE come talk to me.\n\t\t I will have to add a new damage type IN CODE. (We have two different damage type systems, \n\t\t and special abilities use the hard-coded one). See Damage_Wampa for example of this.\n\t\t -Oksana   --> \n\n\t<Damage_Types> \n\t\tDamage_Default, \n\t\tDamage_ATST,\n\t\tDamage_ATAT,\n\t\tDamage_Fighter,\n\t\tDamage_Assault_Frigate,\n\t\tDamage_Diamond_Missile, \n\t\tDamage_IonCannon, \n\t\tDamage_IonCannon_LRG, \n\t\tDamage_Proton_Torp, \n\t\tDamage_Proton_Torp_Light, \n\t\tDamage_Con_Missile, \n\t\tDamage_Turbolaser, \n\t\tDamage_Blaster_Hand, \n\t\tDamage_PLEX, \n\t\tDamage_Sniper, \n\t\tDamage_Lightning, \n\t\tDamage_Lightsaber, \n\t\tDamage_ThermDet, \n\t\tDamage_Wookiee, \n\t\tDamage_Jawa, \n\t\tDamage_StickyBomb,\n\t\tDamage_Hero_StickyBomb,\n\t\tDamage_Blaster_Cannon, \n\t\tDamage_Flak_Pod, \n\t\tDamage_AI_Turret, \n\t\tDamage_AV_Turret,\n\t\tDamage_TIE_Mauler,\n\t\tDamage_2M_Repulsortank,\n\t\tDamage_Laser_GRND, \n\t\tDamage_Proton_GRND, \n\t\tDamage_Con_Missile_GRND, \n\t\tDamage_Con_Missile_T4B,\n\t\tDamage_Con_Grenade, \n\t\tDamage_SPMAT_Grenade, \n\t\tDamage_Bomb, \n\t\tDamage_Hyper_Gun, \n\t\tDamage_Ion_Planet,\n\t\tDamage_Rancor, \n\t\tDamage_Laser_T4B,\n\t\tDamage_Blaster_T2B,\n\t\tDamage_Star_Destroyer,\n\t\tDamage_Calamari_Cruiser,\n\t\tDamage_Station_Laser,\n\t\tDamage_Station_Turbolaser,\n\t\tDamage_Acclamator,\n\t\tDamage_Acclamator_TL,\n\t\tDamage_Interdictor,\n\t\tDamage_Victory_SD,\n\t\tDamage_IPV,\n\t\tDamage_Nebulon_B,\n\t\tDamage_Tartan_Cruiser,\n\t\tDamage_Corellian_Corvette,\n\t\tDamage_Corellian_Gunboat,\n\t\tDamage_Turbo_GRND,\n\t\tDamage_Wall_Destruction,\n\t\tDamage_Self_Destruct,\n        Damage_AWing,\n\t\tDamage_Force_Pike,\n\t\tDamage_BugBite,\n\t\tDamage_StarBase_Self_Destruct,\n\t\tDamage_Sonic_Blaster,\n\t\tDamage_Airspeeder,\n\t\tDamage_Disruptor_Hand,\n\t\tDamage_Pulse_Cannon,\n\t\tDamage_Ion_Cannon_Land,\n\t\tDamage_Droideka_Blaster,\n\t\tDamage_Juggernaut_Turret,\n\t\tDamage_DarkTrooper1_Sword,\n\t\tDamage_DarkTrooper2_Cannon,\n\t\tDamage_Plant_Spike,\n\t\tDamage_Pulse_Cannon_Tank,\n\t\tDamage_Krayt_Damage_Blast,\n\t\tDamage_Mass_Driver_Turret,\n\t\tDamage_Vornskr_Bite,\n\t\tDamage_Exploding_Barrel,\n\t\tDamage_Tyber_Shotgun,\n\t\tDamage_Mass_Driver_Space,\n\t\tDamage_MDU_Rocket,\n\t\tDamage_MDU_Grenade,\n\t\t\n\t\t\n\t\t<!-- PLEASE add your new damage types ABOVE this point.\n\t\t\t The damage types below are from hard-coded damage enumeration. You can specify Armor type for them if you want\n\t\t\t (and understand how and where these are applied).\n\t\t\t In the future, we will merge two system together, but for now we have to have this work-around. \n\t\t\t -Oksana\t\t\t-->\n\t\tDamage_Normal,\n\t\tDamage_Force_Whirlwind,\n\t\tDamage_Force_Telekinesis,\n\t\tDamage_Force_Lightning,\n\t\tDamage_Force_Corruption,\n\t\tDamage_Hard_Point_Self_Destruct,\n\t\tDamage_Fire,\n\t\tDamage_Cable_Attack,\n\t\tDamage_Explosion,\n\t\tDamage_Asteroid,\n\t\tDamage_Cable_Attack_Deployed,\n\t\tDamage_Normal_Deployed,\n\t\tDamage_Vehicle_Thief,\n\t\tDamage_Crush,\n\t\tDamage_Eat,\n\t\tDamage_Redirected,\n\t\tDamage_Wampa,\n        Damage_Infection\n\t\tDamage_Remote_Bomb,\n\t\tDamage_Drain_Life,\n\n\t\t<!-- DO NOT ADD new damage types after this point -->\n\t</Damage_Types>\n\n\n\n\t<!-- ARMOR TYPES that have damage types appliced to them for damage modifiers. These are armor categories for baseline units.\n\t\t\t  if a unit is \"like\" an existing one as far as armor (rps) is concerned, then you can reuse the category. To make a \n\t\t\t  unit tougher or weaker, change its health or shields. To encourage bringing in a different kind of unit to attack it,\n\t\t\t  then change the armor type and associated damage-vs-armor value.\n\t -->\n\t<Armor_Types> \n\t\tArmor_Default, \n\t\tShield_Default,\n        Shield_Capital,\n        Shield_Frigate,\n        Shield_Corvette,\n        Shield_Fighter,\n        Shield_Tank,\t\t <!-- T2B and 2M -->\n        Shield_SSD,\t\t\t<!-- Shield for Executor --> \n\t\tArmor_Transport, \n\t\tArmor_Fighter, \n\t\tArmor_Hero_Transport,\n\t\tArmor_Missile_Cruiser, \n\t\tArmor_Corellian_Corvette, \n\t\tArmor_Tartan, \n\t\tArmor_Interdictor,\n\t\tArmor_Corellian_Gunboat, \n\t\tArmor_Nebulon_B,\n\t\tArmor_Acclamator,\n\t\tArmor_Pirate_Frigate,\n\t\tArmor_Satellite,\n\t\tArmor_Frigate, \n\t\tArmor_Victory_Class, \n\t\tArmor_Assault_Frigate, \n\t\tArmor_Calamari_Cruiser, \n\t\tArmor_Star_Destroyer, \n\t\tArmor_ATST, \n\t\tArmor_Station, \n\t\tArmor_MPTL, \n\t\tArmor_Infantry, \n\t\tArmor_Mauler, \n\t\tArmor_Hero, \n\t\tArmor_Vehicle_LT, <!-- lightly armored vehicles like swamp speeder, land speeder, and pirate skiff -->\n\t\tArmor_Vehicle, \n\t\tArmor_2M,\n\t\tArmor_T2B,\n\t\tArmor_SPMAT,\n\t\tArmor_ATAA,\n\t\tArmor_T4B, \n\t\tArmor_Turret,\n\t\tArmor_Speeder,\t\t<!-- snowspeeder and bombers -->\n\t\tArmor_Structure, \n\t\tArmor_Wall, \n\t\tArmor_ATAT, \n\t\tArmor_Bomber,\n\t\tArmor_Scout_Bike,\n\t\tArmor_Juggernaut,\n\t\tArmor_Vengeance,\n\t\tArmor_Dark_Trooper,\n\t\tArmor_MC30_Frigate,\n\t\tArmor_Vornskr,\n\t\tArmor_Destroyer_Droid,\n\t\tArmor_Bunker\t\t<!-- Bunkers and pillboxes -->\n\t\tArmor_SSD\t\t\t<!-- Armor for the Executor and other SSDs-->\n\t\t\t\t\n\t</Armor_Types>\n\n\t<!-- DAMAGE vs. ARMOR Matrix -->\n\n\t<!-- Default Damage Type -->\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Default, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Shield_Default, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Bomber, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Transport, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Fighter, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Hero_Transport, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Corellian_Corvette, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Missile_Cruiser, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Corellian_Gunboat, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Nebulon_B, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Acclamator, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Pirate_Frigate, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Satellite, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Frigate, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Victory_Class, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Tartan, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Interdictor, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Assault_Frigate, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Calamari_Cruiser, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Star_Destroyer, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Station, 1 </Damage_To_Armor_Mod>\n    <Damage_To_Armor_Mod> Damage_Default, Shield_Capital, 1</Damage_To_Armor_Mod>\n    <Damage_To_Armor_Mod> Damage_Default, Shield_Frigate, 1</Damage_To_Armor_Mod>\n    <Damage_To_Armor_Mod> Damage_Default, Shield_Corvette, 1</Damage_To_Armor_Mod>\n    <Damage_To_Armor_Mod> Damage_Default, Shield_Fighter, 1</Damage_To_Armor_Mod>\n    <Damage_To_Armor_Mod> Damage_Default, Shield_SSD, 1</Damage_To_Armor_Mod>\n    <Damage_To_Armor_Mod> Damage_Default, Shield_Tank, 1</Damage_To_Armor_Mod>\n    <Damage_To_Armor_Mod> Damage_Default, Armor_Vengeance, 1</Damage_To_Armor_Mod>\n    <Damage_To_Armor_Mod> Damage_Default, Armor_MC30_Frigate, 1</Damage_To_Armor_Mod>\n    <Damage_To_Armor_Mod> Damage_Default, Armor_SSD, 1</Damage_To_Armor_Mod>\n\n    <Damage_To_Armor_Mod> Damage_Default, Armor_ATST, 1 </Damage_To_Armor_Mod>\n    <Damage_To_Armor_Mod> Damage_Default, Shield_Tank, 1</Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_MPTL, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Infantry, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Mauler, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Hero, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Vehicle_LT, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Vehicle, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_2M, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_T2B, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_SPMAT, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_ATAA, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_T4B, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Speeder, 1 </Damage_To_Armor_Mod>\n\t<Damage_To_Armor_Mod> Damage_Default, Armor_Structure, 1 </Damage_To_Armor_Mod>\n